import { DataChart, Grid, Box, Meter } from 'grommet';
import React from 'react'

export const Stats = () => {
    return ( 

    <Grid rows={['large', 'large']} columns={['large', 'large']} gap="large" areas={[{ name: 'nav', start: [0, 0], end: [0, 1] },{ name: 'main', start: [1, 0], end: [1, 1] },]}>
        <Box gridArea="nav" background="light-5">
            <DataChart series = {['date', 'amount']}    
                data = {[{
                        date: '2020-05-26',
                        amount: 4000000
                    },
                    {
                        date: '2020-05-27',
                        amount: 2500000
                    },
                    {
                        date: '2020-05-28',
                        amount: 88
                    },]} />
        </Box>
        <Box gridArea="main" background="light-2">
            <Meter type="circle" background="light-2" values={[6,30]} />
        </Box>
    </Grid>


    )
}

export default Stats
